const createRegion = async function (knex, region, geojson) {
  await knex.raw(
    `INSERT INTO region(
      id, 
      name, 
      owner_id, 
      show_on_org_map, 
      calculate_statistics, 
      collection_id, 
      properties,
      shape
    )
    VALUES (?, ?, ?, ?, ?, ?, ?, ST_SETSRID(ST_GeomFromGeoJSON(?), 4326));`,
    [
      region.id,
      region.name,
      region.owner_id,
      region.show_on_org_map,
      region.calculate_statistics,
      region.collection_id,
      region.properties,
      geojson
    ],
  );

}
